import React, { useState } from "react";
import {
  Box,
  Typography,
  Grid,
  Card,
  CardContent,
  List,
  ListItem,
  ListItemText,
  Divider,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const DoctorDashboard = () => {
  const [activeTab, setActiveTab] = useState("dashboard");
  const [message, setMessage] = useState(""); // To display logout message
  const navigate = useNavigate();

  // Logout handler
  const handleLogout = () => {
    setMessage("User logged out");
    setTimeout(() => {
      navigate("/"); // Redirect to home page after 1.5 seconds
    }, 1500);
  };

  // Function to render content dynamically based on activeTab
  const renderContent = () => {
    switch (activeTab) {
      case "dashboard":
        return (
          <Box>
            <Typography variant="h5" gutterBottom>
              Welcome to the Dashboard
            </Typography>
          </Box>
        );
      case "logout":
        return (
          <Typography variant="h5" gutterBottom>
            {message || "Logging out..."}
          </Typography>
        );
      default:
        return <Typography variant="h5">Welcome to Bayer Health Dashboard</Typography>;
    }
  };

  return (
    <Grid container sx={{ height: "100vh" }}>
      {/* Left Navigation Panel */}
      <Grid
        item
        xs={3}
        sx={{
          backgroundColor: "#1976d2",
          color: "#ffffff",
          height: "100%",
          padding: 2,
        }}
      >
        <Typography variant="h6" gutterBottom>
          Bayer Health
        </Typography>
        <Divider sx={{ mb: 2, backgroundColor: "rgba(255, 255, 255, 0.5)" }} />
        <List>
          <ListItem button onClick={() => setActiveTab("dashboard")}>
            <ListItemText primary="Dashboard" sx={{ color: "#ffffff" }} />
          </ListItem>
          <ListItem button onClick={handleLogout}>
            <ListItemText primary="Logout" sx={{ color: "#ffffff" }} />
          </ListItem>
        </List>
      </Grid>

      {/* Right Content Panel */}
      <Grid item xs={9} sx={{ padding: 3, backgroundColor: "#f5f5f5" }}>
        {renderContent()}
      </Grid>
    </Grid>
  );
};

export default DoctorDashboard;
